import { FunctionComponent, useContext } from "react";
import styled from "styled-components";
import { theme } from "../../../styles/theme/theme";

import AuthContext from "../../../context/auth/AuthContext";

const ProfileImage = styled.img`
  width: 50px;
  height: 50px;
  color: ${theme.colors.text.grey};
  margin-right: ${theme.spacing.space.large};
  border-radius: 50%;
  outline: 2px solid ${theme.colors.border};
`;

const NavBarImage: FunctionComponent = () => {
  const authContext = useContext(AuthContext);
  const { authState } = authContext;

  return (
    <ProfileImage src={authState.user?.profileImage ? authState.user?.profileImage : "./images/default-profile.svg"} />
  );
};

export default NavBarImage;
